  <script type="text/javascript">
    $(document).ready(function(){
        
      $('#form1').submit(function(e){
          e.preventDefault();
        }).validate({
            rules: {
                name: {
                    required: true,
                    minlength: 2
                },
                email: {
                    required: true,
                    email: true
                },
                tel: {
                    required: true,
                    minlength: 8
                },
                desc: {
                  required: true
                  }    
            },
            messages: {
                name: "Please input your name",
                tel: {
                    required: "Please input your number",
                    minlength: "Please input your number"
                },email:{
                    required: "Please input your email"
                },desc: {
                  required: "Send us your message ! "
                }
            },
            submitHandler: function(form){
              return sendEmail();
            }
             
        });
    });



    function sendEmail(){
        
        var name = $("#name");
        var email = $("#email");
        var tel = $("#tel");
        var desc = $("#desc");


        if(name && email && tel && desc){
            $.ajax({
                url: 'sendEmail.php', 
                method: 'POST',
                dataType: 'json',
                data:{
                    name: name.val(),
                    email: email.val(),
                    tel: tel.val(),
                    desc: desc.val()
                }
                
            });
            
           
            $('#submit1').attr("value", "Please wait . . .");
            setTimeout('window.location.href = "https://www.magnusdigital.co.id/thankyou.html";', 3000);
        }
      }

  </script>

